import React from "react";
import { useParams, useLocation} from "react-router-dom";

const User = () =>{
    const { fname, lname } = useParams();

    const location = useLocation();
    return(
        <>
        <div className="box_center">
        <h1>Hi I am User : {fname} {lname} </h1> 

        <li>My Link Path : {location.pathname}</li>
        
        { location.pathname === `user/Pooja/Raval`? <button>Click Me</button> : null}
        </div>
        </>
    );
}
export default User;
